    // Parse CSV data into an array of objects
    var rows = csvData.trim().split('\n');
    var header = rows[0].split(',');
    var data = rows.slice(1).map(function(row) {
        var values = row.split(',');
        var obj = {};
        for (var i = 0; i < header.length; i++) {
            obj[header[i].trim()] = values[i].trim();
        }
        return obj;
    });

    // Layout Configuration
    var layout = {
        autosize: true,
        hovermode: 'closest',
        mapbox: {
            style: 'open-street-map',
            center: {lat: 48, lon: -100},
            zoom: 3,
        },
        margin: {l: 0, r: 0, t: 0, b: 0},
    };

    // Create Plotly Express Map
    Plotly.newPlot('map', [{
        type: 'scattermapbox',
        lat: data.map(d => parseFloat(d.LATITUDE)),
        lon: data.map(d => parseFloat(d.LONGITUDE)),
        mode: 'markers',
        marker: {
            size: 12,
            color: 'rgb(255, 0, 0)',
        },
        text: data.map(d => d.Municipality),
        hoverinfo: 'text'
    }], layout);
